    static propTypes = {
        item: PropTypes.object.isRequired,
    };

    render() {
        const {item} = this.props
        console.log(`Item are ${item.title}`)
        return <ItemStyles>
            <p>{item.title}</p>
        </ItemStyles>
    }
}
